import * as React from 'react';
import {Text, TouchableOpacity, View} from 'react-native';
export default function Settings(){
    return(
        <View>
        <Text>Settings</Text>
        <TouchableOpacity><Text>Dark Mode</Text></TouchableOpacity>
        
        </View> 
        );


}
